 ('1', '1', 'fr_fr', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2015-07-22 10:53:27', '2015-07-23 16:39:35', '287b2dc8-03a4-4630-b856-fcebd1e9045f'),
 ('2', '2', 'fr_fr', 'Before Bar', '<p>It’s true, this site doesn’t have a whole lot of content yet, but don’t worry. Our web developers have just installed the CMS, and they’re setting things up for the content editors this very moment. Soon Localhost will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again.</p>', 'Forfaits', 'À la carte', 'Events', 'Pro', 'Presse', 'Social', 'Contact', 'Créateur de beauté', 'Before Beauty Bar vous sublime avant chaque événement', 'Prendre rendez-vous', 'Les forfaits Before', '<p class=\"norm\">Before Beauty Bar est le premier bar à beauté avant événements.<br>\r\n	Dans l\'air du temps, son concept associe un forfait beauté rapide et accessible à chaque occasion de la vie d\'une femme.<br>Découvrez ci-dessous nos 4 forfaits stars. Pour celles qui ne trouvent pas leur bonheur,<br>\r\n	Before propose aussi des <a href=\"#soins\">prestations à la carte</a>.\r\n</p>', 'Découvrir le forfait', 'Events', 'Privatisez pour tous vos events (EVJF, baby shower…)', '<p class=\"offer-desc\">Pour toutes vos occasions entre filles<br><br><br>\r\n	+ Vernis semi-permanent<br><br>\r\n	+ Beauté des mains & des pieds<br><br>\r\n	+ Atelier make-up entre filles<br><br>\r\n	...\r\n</p>', 'A partir de 40€ / personne', 'Dating & Party', '<p class=\"offer-desc\">        \r\n	Avant un RDV professionnel ou amoureux\r\n	<br><br><br>	\r\n	+ Brushing ou coiffure d\'un soir\r\n	<br><br>\r\n	+ Maquillage<br><br>\r\n	+ Beauté mains avec pose de vernis\r\n</p>', 'Avant un RDV professionnel ou amoureux', 'A partir de 45€ / personne', 'Wedding', 'Pour être au top le plus beau jour de votre vie', '<p class=\"offer-desc\">\r\n	Pour être au top le plus beau jour de votre vie<br><br><br>\r\n	+ Essai maquillage ou coiffure<br><br>\r\n	+ Maquillage et coiffure du Jour J<br><br>\r\n	+ Formule complète sur 8 jours jusqu’au mariage<br><br>\r\n	...\r\n</p>', 'A partir de 100€', 'The Beach', 'Pour être belle des pieds à la tête pour vos vacances', '<p class=\"offer-desc\">\r\n	Pour être belle des pieds à la tête pour vos vacances<br><br><br>\r\n	+ Beauté mains, pieds, et pose de vernis<br><br>\r\n	+ Beauté mains, pieds, et vernis semi-permanent<br><br>\r\n	+ Beauté mains, pieds, vernis, maillot brésilien, et jambes complètes<br><br>\r\n	+ Beauté mains, pieds, vernis, maillot brésilien, demi-jambes, et aisselles<br><br>\r\n	...\r\n</p>', 'A partir de 54€ / personne', 'Bar à coiffure', 'Soins à la carte', '<p class=\"contentpop\">Nos professionnels vous accueilllent et mettent leur expertise à votre service. Elégant, léger ou électrique : tous les styles sont permis !<br>\r\n	A partir de 20€\r\n</p>', 'Bar à ongles', '<p class=\"contentpop\">Profitez d’un savoir-faire unique pour être belle jusqu’au bout des ongles ! Une touche de vernis sublimera vos pieds et mains à merveille.<br>\r\n	A partir de 10€\r\n</p>', 'Bar à maquillage', '<p class=\"contentpop\">Quelle que soit l’occasion, votre visage est au centre de nos attentions. A travers les teintes et les textures, faites-vous chouchouter selon vos envies !<br>\r\n	A partir de 25€\r\n</p>', 'Spa urbain', '<p class=\"contentpop\">Prenez un moment de détente pour vous ressourcer et énergiser votre peau. Nos soins sont variés et complets pour une sensation durable de fraîcheur.<br>\r\nA partir de 35€\r\n</p>', '<p class=\"norm\">La Before Team se déplace chez vous ou dans le lieu de votre choix ! Nos Before Artists sont à vos côtés pour vous conseiller et vous sublimer lors de tous vos événements.\r\n</p>', 'À DOMICILE', '<p class=\"norm\">Privatisez l\'un de nos salons design & girly pour toutes vos occasions entre filles : EVJF, baby shower, anniversaire&hellip; Pour  un moment unique et inoubliable rien qu’entre vous.</p>', 'Before Events', 'En savoir plus', '<p><br></p>\r\n<p>Parce que Before est aussi une conciergerie beauté de luxe, nous vous accompagnons dans vos événements professionnels avec nos formules d’animations beauté pour les entreprises : Nail bar, maquillage, bar à tresses, bar à brushing...\r\n</p>', 'Espace Pro', 'Presse', '<p class=\"norm\">On parle de nous dans la presse ! Parce que les petits mots élogieux font toujours plaisir, vous pouvez retrouver tous les billets sur le salon et son actualité.\r\n</p>', 'Voir nos parutions', 'We are Social', 'Ne ratez plus aucune actu before !', 'Insta', 'Facebook', 'https://www.facebook.com/Beforebeautybar', 'https://instagram.com/beforebeautybar/', 'Nous Contacter', 'Horaires', 'Adresse', 'Réservation', '<p class=\"norm\">Vous avez une question particulière, vous voulez privatiser notre salon ou souhaitez que l’on vous accompagne lors d’un événement ? Ecrivez-nous, nous vous répondrons dans les plus brefs délais.\r\n</p>', 'Franchise', '', 'CGV', '<p>Contenu CGV</p>', 'Mentions Légales', '<p><strong>PROPRIÉTÉ</strong><br>\r\n	Société éditrice : SARL\r\nBEFORE exerçant sous l’enseigne « Beforebar.com »\r\n	<br>\r\n	Capital social : 8.000 €<br>\r\n	Siège social : 97 bis rue de Jouffroy d’Abbans 75017 Paris France<br>\r\n	Numéro d’identification : 529 779 126 RCS Paris<br>\r\n	N° TVA : FR 53 529 779 126\r\n</p>\r\n<p><strong>PUBLICATION</strong><br>\r\n	Directeur de la publication : Yael KOSKAS<br>\r\n	Téléphone : 01 77 19 12 22 (du mardi au samedi, de 10 h à 19h30)\r\n</p>\r\n<p><strong>CRÉDITS PHOTOS</strong><br>\r\n	Droit de propriété sur les visuels : BEFORE BEAUTY BAR\r\n</p>\r\n<p><strong>HÉBERGEUR</strong><br>\r\n	<a href=\"https://www.ovh.com/fr/\" target=\"_blank\">OVH</a>, 2 rue de Kellermann – BP 80157 ROUBAIX\r\n</p>', 'Crédits', '<p>\r\n	Conception/DA/UX : <a href=\"http://blackpizza.com\" target=\"_blank\">Black Pizza</a><br>\r\n	Intégration & développement : <a href=\"http://blackpizza.com\" target=\"_blank\">Black Pizza</a><br><br>\r\n	Prises de vue :<br>\r\n	- DA : <a href=\"http://blackpizza.com\" target=\"_blank\">Black Pizza</a><br>\r\n	- Photographie : <a href=\"http://www.erwanfichou.org/\" target=\"_blank\">Erwan Fichou</a><br>\r\n	- Coiffure, maquillage, manucure : Before Beauty Bar\r\n</p>', 'Contactez-nous', 'Before 17e', '<p>Du mardi au samedi<br>\r\n	de 10h00 à 19h30</p>', '<p><a href=\"tel:0177191222\">01 77 19 12 22</a>\r\n</p>', '<p><a href=\"https://www.google.fr/maps/place/97+Rue+Jouffroy+d\'Abbans,+75017+Paris/@48.8820013,2.3019859,17z/data=!3m1!4b1!4m2!3m1!1s0x47e66fbe06b14afb:0xc4b10c0280c53462?hl=fr\" target=\"_blank\">97 bis rue Jouffroy d\'Abbans<br>75017 Paris</a>\r\n</p>', 'Before 16e', '<p><a href=\"https://www.google.fr/maps/place/74+Rue+Saint-Didier,+75116+Paris/@48.8677807,2.2817583,17z/data=!3m1!4b1!4m2!3m1!1s0x47e66ff763bf95c1:0xf461b396e5344ba4?hl=fr\" target=\"_blank\">74 rue Saint-Didier<br>75016 Paris</a>\r\n</p>', '<p>Du mardi au samedi<br>de 10h00 à 19h30</p>', '<p><a href=\"tel:0142562648\">01 42 56 26 48</a>\r\n</p>', NULL, NULL, NULL, NULL, 'Votre message à bien été envoyé. Nous vous recontacterons dans les plus brefs délais.', 'https://app.flexybeauty.com/before/home', 'https://app.flexybeauty.com/before-16/home', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Ce champ est obligatoire', 'Bons Cadeaux', 'https://app.flexybeauty.com/before/giftItems', 'Voir le salon', 'Voir le plan', 'Nos salons', 'Contactez-nous', 'javascript:b4_bar.choose_select(1)', 'https://app.flexybeauty.com/before-16/category/6250230219538432', 'Je privatise', 'Voir les formules', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://app.flexybeauty.com/before-16/giftItems', 'Voir les actualités', '<p>Découvrez nos actualités !</p>', 'Actualités', NULL, NULL, 'Produits', 'https://app.flexybeauty.com/before/productCategory/5117101211648000', 'https://app.flexybeauty.com/before-16/productCategory/5700305828184064', '<p><a href=\"https://www.google.fr/maps/place/101+Rue+Pasteur,+Saint-Denis,+R%C3%A9union/@-20.8776622,55.452274,17z/data=!3m1!4b1!4m5!3m4!1s0x21827f04f0e31687:0x4ffd297a4e594477!8m2!3d-20.8776672!4d55.454468\">101 Bis rue Pasteur<br />97400 Saint Denis (La Réunion)</a></p>', '<p><a href=\"tel:+26220262201920762085\">+262 262 19 76 85</a></p>', '<p>Lun. Mar. Jeu. Ven. <br />de 9h00 à 19h00<br />Mer. Sam. de 9h00 à 18h00 </p>', 'Before Réunion', 'https://app.flexybeauty.com/before-reunion/home', 'https://app.flexybeauty.com/before-reunion/giftItems', '2015-07-22 10:53:28', '2017-12-13 17:52:49', 'a0ce11f0-75ea-4332-8014-8b81f03df28b'),
