on, votre visage est au centre de nos attentions. A travers les teintes et les textures, faites-vous chouchouter selon vos envies !<br>\\r\\n\\tA partir de 25\\u20ac\\r\\n<\\/p>\",\"37\":\"Bar \\u00e0 maquillage\",\"36\":\"<p class=\\\"contentpop\\\">Profitez d\\u2019un savoir-faire unique pour \\u00eatre belle jusqu\\u2019au bout des ongles ! Une touche de vernis sublimera vos pieds et mains \\u00e0 merveille.<br>\\r\\n\\tA partir de 10\\u20ac\\r\\n<\\/p>\",\"35\":\"Bar \\u00e0 ongles\",\"40\":\"<p class=\\\"contentpop\\\">Prenez un moment de d\\u00e9tente pour vous ressourcer et \\u00e9nergiser votre peau. Nos soins sont vari\\u00e9s et complets pour une sensation durable de fra\\u00eecheur.<br>\\r\\nA partir de 35\\u20ac\\r\\n<\\/p>\",\"39\":\"Spa urbain\",\"33\":\"Soins \\u00e0 la carte\",\"74\":\"<p><a href=\\\"https:\\/\\/www.google.fr\\/maps\\/place\\/97+Rue+Jouffroy+d\'Abbans,+75017+Paris\\/@48.8820013,2.3019859,17z\\/data=!3m1!4b1!4m2!3m1!1s0x47e66fbe06b14afb:0xc4b10c0280c53462?hl=fr\\\" target=\\\"_blank\\\">97 bis rue Jouffroy d\'Abbans<br>75017 Paris<\\/a>\\r\\n<\\/p>\",\"73\":\"<p><a href=\\\"tel:0177191222\\\">01 77 19 12 22<\\/a>\\r\\n<\\/p>\",\"72\":\"<p>Du mardi au samedi<br>\\r\\n\\tde 10h00 \\u00e0 19h30<\\/p>\",\"87\":\"https:\\/\\/app.flexybeauty.com\\/before\\/home\",\"71\":\"Before 17e\",\"76\":\"<p><a href=\\\"https:\\/\\/www.google.fr\\/maps\\/place\\/74+Rue+Saint-Didier,+75116+Paris\\/@48.8677807,2.2817583,17z\\/data=!3m1!4b1!4m2!3m1!1s0x47e66ff763bf95c1:0xf461b396e5344ba4?hl=fr\\\" target=\\\"_blank\\\">74 rue Saint-Didier<br>75016 Paris<\\/a>\\r\\n<\\/p>\",\"78\":\"<p><a href=\\\"tel:0142562648\\\">01 42 56 26 48<\\/a>\\r\\n<\\/p>\",\"77\":\"<p>Du mardi au samedi<br>de 10h00 \\u00e0 19h30<\\/p>\",\"88\":\"https:\\/\\/app.flexybeauty.com\\/before-16\\/home\",\"75\":\"Before 16e\",\"145\":\"<p><a href=\\\"https:\\/\\/www.google.fr\\/maps\\/place\\/101+Rue+Pasteur,+Saint-Denis,+R%C3%A9union\\/@-20.8776622,55.452274,17z\\/data=!3m1!4b1!4m5!3m